import React from 'react';
import './styles.css';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom'; // Import the necessary components from React Router
import Questionnaire from './Questionnaire';
import AboutMe from './AboutMe';

const App = () => (
  <Router>
    <>
      <Route path="/" exact component={Questionnaire} />
      <Route path="/about" component={AboutMe} />
    </>
  </Router>
);

export default App;
